import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

// Importing components
import WelcomePage from './components/welcomepage.js';
import LoginPage from './components/loginpage.js';
import SignUpPage from './components/signuppage.js';
import ProfilePage from './components/profilepage.js';
import Dashboard from './components/dashboard/userdashboard.js'; // Import the new Dashboard page
import UserProfilePage from './components/userprofile/userprofile.js'; // Add the UserProfilePage import

const App = () => {
  return (
    <Router>
      <div className="App">
        {/* Header with Profile Icon */}
        <header className="App-header">
          <Link to="/user-profile">
            <div className="profile-icon">
              <i className="fa fa-user"></i> {/* You can replace this with an actual profile icon */}
            </div>
          </Link>
        </header>

        {/* Routes */}
        <Routes>
          <Route path="/" element={<WelcomePage />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/signup" element={<SignUpPage />} />
          <Route path="/profile" element={<ProfilePage />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/user-profile" element={<UserProfilePage />} /> {/* Add UserProfilePage route */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
